  02> HARVEY-WILLIAMS, Caren Mae
  b 12.09.1971
  Caren b. at Helensville. She was educated at Whenuapai and Massey High School. Caren has several
  qualifications in secretarial skills and excels in fine art work. She is employed as a graphic
  designer for a sign writing company in West Auckland. She has been a competitive horsewoman and a
  member of Pony and Hunt Clubs for ten years.
  04> WILLIAMS, Nancy Edith Harvey m on 16.12.1933 to COXWELL, Cecil Maurice
  b 19.02.1907
  b 30.05.1900 d 15.02.1986
  Nancy b. at Harrow, England and m, at Rio de Janeiro, Brazil. Address: 20 Cedar Court, Crockford Park Road,
  Addlestone, Surrey KT15 2LQ, England.
  Nancy was educated at Southlands Private School, Harrow. She lived at Rio de Janeiro and Sao Paulo where
  Cecil was employed by the shipping firm of E Johnson & Company. During WW2 he was co-opted by the British
  Government to be in charge of all European ships that entered Brazilian waters.
  b1> COXWELL, Jillian Cecilia m on 16.04.1960 to MUNN, Dugald John David
  b 18.06.1935
  b 26.11.1937
  Jillian b. at Niteroi, Brazil and m. at Woking, Surrey, England. Dugald, slo John Dugald Munn (d. 1959)
  and Sylvia May Cardew (d. 1985).
